properties.description:
evidenzia la posizione dei cassonetti che a seguito degli svuotamenti continuano ad essere spostati dalla loro sede delineata da strisce e per effetto degli spostamenti, le difficoltà della manovra dell’autobus 664 al capolinea di Largo Cosoleto;
Sono è stanco e stressato dai continui fragori dei clacson – ad ogni ora del giorno e della notte – per il mancato spazio necessario al giro degli autobus !!!
Non ne posso più di questi disagi e come me altre centinaia di persone che vivono nei pressi di Largo Cosoleto !!!
